import  Modal  from "react-bootstrap/Modal";
import { useFormik,FormikProvider } from "formik";
import {Field,Form,Formik,Formikprops} from 'formik';
import  Button  from "react-bootstrap/Button";
import {postFunc,updateFunc,deleteFunc,getFunc} from "./Backenddata";

const Model=({show,handleClose,user,setShow,action}) =>{
    return(

    <Modal show={show} onHide={handleClose}>
        <Modal.Header closeButton>
          <Modal.Title>Modal heading</Modal.Title>
        </Modal.Header>
        <Modal.Body>
 
    <h1>Form using formik</h1>
    <Formik
      initialValues={{ name: '',email:'',password:'', age: '' ,role: '' }}
      validate={values => {
        const errors = {};
        if(!values.name){
            errors.name='fill the blanks';
        }else if(values.name<4){
            errors.all='name must be of 3 characters';
        }
        if(!values.email){
            errors.all='fill the blanks';
        }
        else if(values.email=='/^\w+([\.-]?\w+)*@\w+([\.-]?\w+)*(\.\w{2,3})+$/'){
               errors.all='enter valid format';
            }
            
        if(!values.age){
            errors.all='fill the blanks';
        }
    
        if(!values.role){
            errors.all='fill the blanks';
        }
        return errors;
      
      }}


      
      onSubmit={({values}, { setSubmitting }) => {
        // console.log(values.name)
       if(values.name && values.email && values.password && values.age && values.role){
           let res;
           if(action==="add"){
               res = postFunc(values.name,values.email,values.password,values.age,values.role)
           }else if(action==="edit"){
               res=updateFunc(values.id,values.name,values.email,values.password,values.age,values.role)
           }else{
            res=deleteFunc(values.id,values.name,values.email,values.password,values.age,values.role)
           }
       }
         
     getFunc();
     setShow(false);
        //   if(res.status == 200){
        //       getFunc()
        //       setShow(false)
        //   }
      }}
    >
      {({
        values,
        errors,
        touched,
        handleChange,
        handleBlur,
        handleSubmit,
        isSubmitting,
        /* and other goodies */
      }) => (
        <form>
          <input
           
            type="text"
            name="name"
            placeholder='Enter your name..'
            onChange={handleChange}
            onBlur={handleBlur}
            value={values.name}
          /><br></br>
          {errors.name && touched.name&& errors.name}

          <input
            type="email"
            name="email"
            placeholder='Enter your email..'
            onChange={handleChange}
            onBlur={handleBlur}
            value={values.email}
          /><br></br>
         {errors.email && touched.email && errors.email}
         <input
            type="password"
            name="password"
            placeholder='Enter your password..'
            onChange={handleChange}
            onBlur={handleBlur}
            value={values.password}
          /><br></br>
          {errors.password && touched.password && errors.password}
          <input
            type="number"
            name="age"
            placeholder='Enter your age..'
            onChange={handleChange}
            onBlur={handleBlur}
            value={values.age}
          /><br></br>
           {errors.age && touched.age && errors.age}

          
          <Field as="select" name="role">
            <option value="user">User</option>
            <option value="system">System</option>
             <option value="admin">Admin</option>
             </Field><br></br>
             
            
             <br></br>
        <br></br>
         
        <Button variant="primary"  type="submit" value="Submit" onClick={handleSubmit} disabled={isSubmitting}>
          Submit
        </Button>
        </form>
        
      )}
    </Formik>
    </Modal.Body>
        <Modal.Footer>
          <Button variant="primary"  onClick={handleClose}>
          Save Changes 
        </Button>
    
        </Modal.Footer>
      </Modal>

    )
}

export default Model;
